import React from 'react';
import './Dashboard.css';
import Button from '@mui/material/Button';
const Dashboard = () => {
  return (
    <><><div className='dashboard-bg'><Button
    type="submit"
    halfWidth
    variant="contained"
    sx={{ mt: -70, mb: 200, backgroundColor: '#FFCC00', color: '#000000' }} 
  >
    Deposit
  </Button></div></>
  </>
  )
}

export default Dashboard
